import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import {
    Typography,
    CircularProgress,
    Table,
    TableContainer,
    TableHead,
    TableBody,
    TableRow,
    TableCell,
    Paper,
    Grid,
    Card,
    CardContent,
    CardMedia,
    makeStyles
} from '@mui/material';

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
        padding: theme.spacing(2)
    },
    media: {
        height: 200,
        maxWidth: 300,
        objectFit: 'cover',
        margin: 'auto'
    },
    loading: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '300px'
    }
}));

const ViewMovieByID = () => {
    const classes = useStyles();
    const { movieId } = useParams();
    const [reviews, setReviews] = useState([]);
    const [loading, setLoading] = useState(true);
    const [movie, setMovie] = useState(null);
    const token = localStorage.getItem('token');

    useEffect(() => {
        fetchMovieDataById(movieId);
    }, [movieId]);

    const fetchMovieDataById = async (movieId) => {
        try {
            const token = localStorage.getItem('token');
            if (!token) {
                throw new Error('No token found. Please log in.');
            }

            const movieResponse = await axios.get(`http://localhost:8081/api/movie/${movieId}`, {
                headers: { Authorization: `Bearer ${token}` }
            });

            const { title, director, year, imageUrl } = movieResponse.data;
            setMovie({ title, director, year, imageUrl });
            setLoading(false);
        } catch (error) {
            console.error('Error fetching movie data:', error);
            setMovie(null);
            setLoading(false);
        }
    };

    useEffect(() => {
        const fetchReviews = async () => {
            try {
                const response = await axios.get(`http://localhost:8081/api/reviews/movie/${movieId}`, {
                    headers: { Authorization: `Bearer ${token}` }
                });
                setReviews(response.data);
                setLoading(false);
            } catch (error) {
                console.error('Error fetching reviews:', error);
                setLoading(false);
            }
        };

        if (token) {
            fetchReviews();
        }
    }, [token, movieId]);

    return (
        <div className={classes.root}>
            <Typography variant="h4" gutterBottom>Movie Details</Typography>
            {loading ? (
                <div className={classes.loading}>
                    <CircularProgress />
                </div>
            ) : movie ? (
                <Grid container spacing={3}>
                    <Grid item xs={12} sm={6}>
                        <Card>
                            <CardMedia
                                className={classes.media}
                                image={movie.imageUrl}
                                title={movie.title}
                            />
                        </Card>
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <Card>
                            <CardContent>
                                <Typography variant="h6" gutterBottom>{movie.title}</Typography>
                                <Typography variant="body1">Director: {movie.director}</Typography>
                                <Typography variant="body1">Year: {movie.year}</Typography>
                            </CardContent>
                        </Card>
                    </Grid>
                </Grid>
            ) : (
                <Typography variant="body1" color="error">Error fetching movie details.</Typography>
            )}

            <Typography variant="h4" gutterBottom>Reviews</Typography>
            {loading ? (
                <div className={classes.loading}>
                    <CircularProgress />
                </div>
            ) : reviews.length > 0 ? (
                <TableContainer component={Paper}>
                    <Table>
                        <TableHead>
                            <TableRow>
                                <TableCell>Username</TableCell>
                                <TableCell>Content</TableCell>
                                <TableCell>Rating</TableCell>
                                <TableCell>Reviewed On</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {reviews.map(review => (
                                <TableRow key={review.id}>
                                    <TableCell>{review.username}</TableCell>
                                    <TableCell>{review.content}</TableCell>
                                    <TableCell>{review.rating}</TableCell>
                                    <TableCell>{new Date(review.createdAt).toLocaleDateString()}</TableCell>
                                </TableRow>
                            ))}
                        </TableBody>
                    </Table>
                </TableContainer>
            ) : (
                <Typography variant="body1">No reviews available for this movie.</Typography>
            )}
        </div>
    );
};

export default ViewMovieByID;
